  const API = process.env.REACT_APP_BACKEND_URL || 'http://localhost:8001';

  const fetchTodayBookings = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`${API}/api/admin/bookings/today`);
      setBookings(response.data.bookings);
